COSObject cosObject = acquireItem( j );
if ( cosObject instanceof COSInteger )
{
    result[j] = ((COSInteger)cosObject).intValue();
}
else
{
    result[j] = ((COSFloat)cosObject).floatValue();
}

COSBase cosItem = acquireItem( j );
if( cosItem instanceof COSFloat )
{
    COSFloat cosFloat = (COSFloat)cosItem;
    result[j] = cosFloat.floatValue();
}
else if( cosItem instanceof COSInteger )
{
    COSInteger cosInteger = (COSInteger)cosItem;
    result[j] = cosInteger.floatValue();
}

COSBase cosBase = acquireItem( j );
if( cosBase instanceof COSNumber )
{
    result[j] = ((COSNumber)cosBase).floatValue();
}
else
{
    throw new IllegalArgumentException( "COSArray{0} should be a COSNumber, instead " + cosBase.getClass().getName() );
}

